import React, { Component, Fragment } from "react";
import Banner from "../../Components/Banner/Banner";

class BannerContainer extends Component {
  render() {
    return (
      <Fragment>
        <Banner />
      </Fragment>
    );
  }
}

export default BannerContainer;
